import React from "react";
import useFormContext from "../hooks/use-form-context";
import EuroIcon from "./icons/euro";
import Input from "./input";
import Select from "./select";

export default function FormInput() {
  const { page } = useFormContext();
  const display: Record<number, any> = {
    0: <PayRollForm />,
    1: <InfoForm />,
  };
  return <div className="h-[450px] w-full lg:w-3/4">{display[page]}</div>;
}

const InfoForm = () => {
  const { userInfo, handleChangeUserInfo } = useFormContext();
  return (
    <div className="space-y-6">
      <pre>{JSON.stringify({ userInfo }, null, 2)}</pre>
      <div className="space-y-6">
        <h2 className="font-bold text-secondary-2">
          Please fill the form below to see the results
        </h2>
        <div className="flex flex-col space-y-4">
          <Select
            onChange={handleChangeUserInfo}
            name={"title"}
            value={userInfo.title}
            label="Title"
            options={[
              { label: "Mr", value: "Mr" },
              { label: "Mrs", value: "Mrs" },
              { label: "Miss", value: "Miss" },
            ]}
          />
          <div className="flex space-x-4">
            <div className="flex-1">
              <Input
                value={userInfo.firstName}
                placeholder="john"
                label="First name"
                name="firstName"
              />
            </div>
            <div className="flex-1">
              <Input
                value={userInfo.lastName}
                placeholder="Example"
                label="Last name"
                name="lastName"
              />
            </div>
          </div>
          <Input
            value={userInfo.company}
            placeholder="Example"
            label="Company"
            name="company"
          />
          <div className="flex space-x-4">
            <div className="flex-1">
              <Input
                value={userInfo.phoneNumber}
                placeholder="+1 000 00 00"
                label="Phone number"
                name="phoneNumber"
              />
            </div>
            <div className="flex-1">
              <Input
                value={userInfo.email}
                placeholder="example@gmail.com"
                label="Email address"
                name="email"
              />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
const PayRollForm = () => {
  const { handleChange, data } = useFormContext();
  return (
    <div className="space-y-6">
      <div className="space-y-6">
        <h2 className="font-bold text-secondary-2">Eligible Wages</h2>
        <div className="flex flex-col space-y-7">
          <Input
            onChange={handleChange}
            icon={<EuroIcon />}
            type="number"
            value={data.totalGrossWages}
            name="totalGrossWages"
            label="Total gross wages of R&D employees/year"
          />
          <Input
            type="number"
            onChange={handleChange}
            name="totalProjectPerMonth"
            value={data.totalProjectPerMonth}
            action={{
              label: "Monate",
              onClick: () => {},
            }}
            label="Total project months (No limit to the duration of a project)"
          />
        </div>
      </div>

      <div className="space-y-6">
        <h2 className="font-bold text-secondary-2">Contract Research</h2>

        <div className="flex flex-col space-y-7">
          <Input
            onChange={handleChange}
            name="ordersFromThirdParties"
            value={data.ordersFromThirdParties}
            icon={<EuroIcon />}
            type="number"
            label="Orders from third parties for your R&D projects (Net)"
          />
        </div>
      </div>
    </div>
  );
};
